import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css'; // Import Bootstrap CSS

const About = () => {
  return (
    <section id="about" className="py-5 bg-light">
      <div className="container">
        <h1 className="display-4 text-center mb-4">About Us</h1>
        <p className="lead mb-4">
          Lorem ipsum dolor sit amet, consectetur adipiscing elit. Ut massa massa, gravida vel dolor eget, ultricies scelerisque sapien. Donec elementum, ligula sed laoreet volutpat, nisl nibh iaculis velit, nec ultrices magna mi eu diam. Phasellus turpis erat, euismod non lorem ut, placerat accumsan ligula.
        </p>
        <p className="mb-4">
          Vestibulum ante ipsum primis in faucibus orci luctus et ultrices posuere cubilia curae; Phasellus vitae est dignissim lorem scelerisque finibus. Aliquam eget placerat neque, quis tincidunt augue. Nunc nec erat condimentum tellus luctus semper quis eu justo. Vivamus ultrices mollis tellus, in convallis enim condimentum nec. Vivamus commodo ac nisi nec vulputate. Ut interdum tempus justo, eu pellentesque libero lacinia a. Nam faucibus dolor at tellus tincidunt feugiat.
        </p>
        <p className="mb-4">
          Nunc quam velit, aliquam viverra nulla sed, cursus gravida ex. Nunc urna magna, rhoncus sit amet nulla at, efficitur fringilla ex. Nam ut pellentesque turpis. Interdum et malesuada fames ac ante ipsum primis in faucibus. Aenean porttitor mattis suscipit. Pellentesque eu consequat arcu. Suspendisse potenti.
        </p>
        <p>
          Donec euismod interdum nisi, sit amet gravida elit viverra nec. Mauris odio erat, eleifend sed tortor at, varius porta mauris. Integer id urna eu nunc congue faucibus ac sed leo. Interdum et malesuada fames ac ante ipsum primis in faucibus. Suspendisse viverra metus a bibendum semper. Lorem ipsum dolor sit amet, consectetur adipiscing elit. Vivamus sed ante vitae augue consectetur elementum. Cras pharetra ligula lacus.
        </p>
      </div>
    </section>
  );
};

export default About;
